import React from "react";

const WaitList = () => {
  return (
    <div className="flex justify-center items-center">
      <button className="relative bg-black text-white text-lg font-semibold py-3 px-8 rounded-full border border-gray-700 shadow-md hover:shadow-lg transition">
        Join Waitlist
        <span className="absolute inset-x-0 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full opacity-50 blur-md"></span>
      </button>
    </div>
  );
};

export default WaitList;
